(function execute(inputs, outputs) {
  // dot walk from the given package to get values
  var package = inputs.package;
  outputs.name = package.project_overview.title.toString();
  outputs.number = package.number.toString();
  var base = package.period_of_performance.base_period.period_unit_count.toString();
  var unit = package.period_of_performance.base_period.period_unit.toString();
  var basePeriod = base + ' ' + unit;
  outputs.base_period =  basePeriod

  // using Database View
  var dbView = new GlideRecord('x_g_dis_atat_acquisition_package_provisioning_jobs')
  dbView.query('acqpkg_sys_id', package.sys_id)
  dbView.next()

  outputs.acq_number = dbView.acqpkg_number.toString()
  outputs.acq_status = dbView.acqpkg_status.getDisplayValue().toString()
  outputs.job_status = dbView.projob_status.getDisplayValue().toString()
  outputs.job_type = dbView.projob_job_type.getDisplayValue().toString()


  // build JSON string for output
  try {
    var jsonBuilder = new sn_ih.JSONStreamingBuilder().build();
  	jsonBuilder.startObject()
      .enablePrettyPrint()
      .writeFieldName("Name")
      .writeString(package.project_overview.title.toString())
      .writeFieldName("Number")
      .writeString(package.number)
      .writeFieldName("Base Period")
      .writeString(basePeriod)
      .writeFieldName("Spacer")
      .writeString("--------------Database View Data----------")
      .writeFieldName("Acq Number")
      .writeString(outputs.acq_number)
      .writeFieldName("Acq Status")
      .writeString(outputs.acq_status)
      .writeFieldName("Job Status")
      .writeString(outputs.job_status)
      .writeFieldName("Job Type")
      .writeString(outputs.job_type)
      .endObject();
  	outputs.payload = jsonBuilder.getJSONString();
  } catch (error) {
    gs.error("An error: " + error);
  } finally {
    jsonBuilder.close()
  }

})(inputs, outputs);

